import React from "react";
import AboutLayout from "./About-page/AboutLayout";
import { Routes, Route } from "react-router-dom";
import OriginalLayout from "./About-page/OriginalLayout";

function About() {
  return (
    <div>
      <AboutLayout />
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route path="/AboutLayout" element={<AboutLayout />} />
        <Route path="/OriginalLayout " element={<OriginalLayout />} />
      </Routes>
    </div>
  );
}

export default About;
